import { useState } from "react";
import { useLocation } from "react-router-dom";
import { Footer } from "../components/Footer";
import { Header } from "../components/Header";
import { MainBody } from "../components/MainBody";
import { PopupBlock } from "../components/PopupBlock";
import { HomeSub } from "../components/subScreens/HomeSub";
import { OrderTransactionSub } from "../components/subScreens/OrderTransactionSub";
import { FiltersList } from "../locales/filters";
import { Filter } from "../models/Filter";

export const OrderTransactionScr = () => {
  const { state } = useLocation();
  return (
    <MainBody>
      <PopupBlock />

      <OrderTransactionSub data={state.cart} />
    </MainBody>
  );
};
